import React from "react";
import {NavLink, Link} from "react-router-dom";

function NavBar() {
    return (
        <nav>
            <ul className="NavBar" style={{ display: 'flex', gap: '10px', listStyleType: 'none' }}>
                    <li>
                        <NavLink to="/about">
                            About
                        </NavLink>
                    </li>
                    <li>
                        <NavLink exact="true" to="/">
                            Home
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/favorites">
                            Favorite Kittens
                        </NavLink>
                    </li>
                </ul>
            </nav>
        );
    }

export default NavBar;
